  img,
  time,
  name,
  university,
  course,
  text,
}) => {
  return (
    <div className={s.container}>
        <div className={s.image} style={{backgroundImage: {img}}}/>
      <img src={img} alt="photo" />
      <div className={s.sentence}>до {time} лет тюрьмы</div>
      <p className={s.name}>{name} </p>
      <p className={s.university}>
        {university}, {course} курс
      </p>
      <p className={s.text}>{text}</p>
    </div>
  );
};

export default Prisoner;
